import React, { Component } from 'react'

export class GoogleAuth extends Component {
  componentDidMount() {
      window.gapi.load("client:auth2", () => {
          window.gapi.client.init
      });
  } 

  render() {
    return (
      <div>
        GoogleAuth
      </div>
    );
  }
}

export default GoogleAuth;
